<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>SOURCEEXPLORER - ROOT</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Share+Tech+Mono&family=VT323&display=swap');

        *, *::before, *::after { margin: 0; padding: 0; box-sizing: border-box; }

        body, html {
            width: 100%; height: 100%;
            background-color: #000;
            color: white;
            font-family: 'Share Tech Mono', 'Courier New', monospace;
            overflow: hidden;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        /* ===== CHECKERBOARD BG ===== */
        .background-missing {
            position: fixed;
            top: 0; left: 0; width: 100%; height: 100%;
            background-image:
                linear-gradient(45deg, #ff0000 25%, transparent 25%),
                linear-gradient(-45deg, #ff0000 25%, transparent 25%),
                linear-gradient(45deg, transparent 75%, #ff0000 75%),
                linear-gradient(-45deg, transparent 75%, #ff0000 75%);
            background-size: 100px 100px;
            background-position: 0 0, 0 50px, 50px 50px, 50px 0;
            z-index: 0;
        }

        /* ===== CRT EFFECT ===== */
        .crt-effect {
            position: fixed;
            top: 0; left: 0; width: 100%; height: 100%;
            background: linear-gradient(rgba(18,16,16,0) 50%, rgba(0,0,0,0.18) 50%),
                        linear-gradient(90deg, rgba(255,0,0,0.03), rgba(0,255,0,0.01), rgba(0,0,255,0.03));
            background-size: 100% 3px, 3px 100%;
            pointer-events: none;
            z-index: 10;
        }
        .crt-effect::after {
            content: " ";
            display: block;
            position: absolute;
            top: 0; left: 0; bottom: 0; right: 0;
            background: radial-gradient(rgba(18,16,16,0) 50%, rgba(0,0,0,0.45) 100%),
                        rgba(18,16,16,0.08);
            pointer-events: none;
        }

        /* Moving scan line */
        .crt-scanline {
            position: fixed;
            top: 0; left: 0; width: 100%;
            height: 120px;
            background: linear-gradient(to bottom,
                transparent 0%,
                rgba(255,255,255,0.03) 40%,
                rgba(255,255,255,0.06) 50%,
                rgba(255,255,255,0.03) 60%,
                transparent 100%
            );
            animation: scan 7s linear infinite;
            pointer-events: none;
            z-index: 11;
        }
        @keyframes scan {
            0%   { top: -120px; }
            100% { top: 100vh; }
        }

        /* Glitch band */
        .crt-glitch-band {
            position: fixed;
            inset: 0;
            z-index: 12;
            pointer-events: none;
            background: rgba(255,0,255,0.06);
            opacity: 0;
        }
        .crt-glitch-band.active {
            animation: glitch-anim 0.15s steps(1) forwards;
        }
        @keyframes glitch-anim {
            0%   { clip-path: inset(40% 0 60% 0); transform: translate(-4px,0); opacity:0.7; }
            25%  { clip-path: inset(10% 0 85% 0); transform: translate(4px,0);  opacity:0.8; }
            50%  { clip-path: inset(70% 0 20% 0); transform: translate(-2px,0); opacity:0.6; }
            75%  { clip-path: inset(30% 0 50% 0); transform: translate(3px,0);  opacity:0.9; }
            100% { clip-path: inset(0 0 100% 0);  transform: translate(0,0);    opacity:0;   }
        }

        /* ===== LAYOUT ===== */
        .container {
            display: flex;
            gap: 25px;
            z-index: 5;
            padding: 20px;
        }

        /* ===== TERMINAL WINDOW ===== */
        .terminal-window {
            width: 500px;
            height: 500px;
            background: black;
            border: 6px solid #000;
            display: flex;
            flex-direction: column;
            padding: 35px;
            position: relative;
            box-shadow: 0 0 20px rgba(0,0,0,0.5);
        }

        .terminal-header {
            font-size: 1.2rem;
            letter-spacing: 4px;
            border-bottom: 2px solid #222;
            padding-bottom: 12px;
        }

        .nav-area {
            margin-top: 40px;
        }

        .nav-item {
            font-size: 1.4rem;
            margin: 25px 0;
            cursor: pointer;
            text-transform: uppercase;
            width: fit-content;
            color: #ccc;
            letter-spacing: 1px;
            transition: color 0.1s;
            user-select: none;
        }
        .nav-item:hover { color: #f0f; }

        #msg-box {
            margin-top: auto;
            color: #ff0000;
            font-size: 1.3rem;
            min-height: 1.5rem;
            letter-spacing: 2px;
            font-family: 'VT323', monospace;
            text-shadow: 0 0 10px #ff0000;
        }

        /* ===== CLOCK WINDOW ===== */
        .clock-window {
            width: 500px;
            height: 500px;
            background: conic-gradient(#000 0% 25%, #f0f 25% 50%, #000 50% 75%, #f0f 75% 100%);
            border: 12px solid #000;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            gap: 10px;
            position: relative;
        }

        #clock-face {
            width: 360px;
            height: 360px;
            border: 4px solid white;
            position: relative;
            background: rgba(0,0,0,0.75);
            flex-shrink: 0;
        }

        .hand {
            position: absolute;
            bottom: 50%;
            left: 50%;
            transform-origin: bottom;
            background: white;
        }
        .h-hand { width: 8px; height: 100px; z-index: 3; }
        .m-hand { width: 5px; height: 135px; z-index: 4; }
        .s-hand { width: 2px; height: 155px; background: red; z-index: 5; }

        .num {
            position: absolute;
            color: white;
            font-weight: bold;
            font-size: 1.1rem;
            text-shadow: 2px 2px #000;
            font-family: 'Share Tech Mono', monospace;
        }

        /* Countdown strip below clock */
        .countdown-strip {
            display: flex;
            gap: 16px;
            align-items: flex-end;
        }

        .cd-unit {
            display: flex;
            flex-direction: column;
            align-items: center;
        }

        .cd-value {
            font-family: 'VT323', monospace;
            font-size: 2.6rem;
            color: #000;
            line-height: 1;
            background: #f0f;
            padding: 2px 8px;
            min-width: 60px;
            text-align: center;
        }

        .cd-label {
            font-family: 'Share Tech Mono', monospace;
            font-size: 0.55rem;
            color: #f0f;
            letter-spacing: 2px;
            margin-top: 3px;
        }

        .cd-sep {
            font-family: 'VT323', monospace;
            font-size: 2.6rem;
            color: #f0f;
            line-height: 1;
            padding-bottom: 18px;
            animation: blink-sep 1s step-end infinite;
        }
        @keyframes blink-sep {
            0%, 100% { opacity: 1; }
            50% { opacity: 0; }
        }

        /* ===== FILES PAGE ===== */
        #files-page {
            display: none;
            position: fixed;
            inset: 0;
            background: #000;
            z-index: 50;
            flex-direction: column;
        }
        #files-page.active { display: flex; }

        .files-header {
            display: flex;
            align-items: center;
            padding: 16px 24px;
            border-bottom: 1px solid #1a1a1a;
            background: #050505;
            flex-shrink: 0;
        }
        .files-back {
            font-family: 'Share Tech Mono', monospace;
            font-size: 12px;
            color: #444;
            cursor: pointer;
            letter-spacing: 2px;
            margin-right: 30px;
            transition: color 0.2s;
        }
        .files-back:hover { color: #fff; }
        .files-title {
            font-family: 'Share Tech Mono', monospace;
            font-size: 14px;
            color: #333;
            letter-spacing: 4px;
        }
        .files-label {
            margin-left: auto;
            font-family: 'VT323', monospace;
            font-size: 20px;
            color: #cc0000;
            letter-spacing: 3px;
        }
        .pdf-container {
            flex: 1;
            overflow: hidden;
            position: relative;
        }
        .pdf-container iframe { width: 100%; height: 100%; border: none; }

        .files-footer {
            display: flex;
            justify-content: flex-end;
            align-items: center;
            padding: 16px 32px;
            border-top: 1px solid #1a1a1a;
            background: #050505;
            position: relative;
            flex-shrink: 0;
        }
        .next-btn {
            font-family: 'Share Tech Mono', monospace;
            font-size: 14px;
            color: #fff;
            background: transparent;
            border: 1px solid #333;
            padding: 10px 28px;
            cursor: pointer;
            letter-spacing: 3px;
            transition: border-color 0.2s, color 0.2s;
        }
        .next-btn:hover { border-color: #cc0000; color: #cc0000; }

        #files-not-now {
            display: none;
            position: absolute;
            inset: 0;
            background: rgba(0,0,0,0.92);
            z-index: 200;
            justify-content: center;
            align-items: center;
            flex-direction: column;
        }
        #files-not-now.active { display: flex; }
        .files-not-now-text {
            font-family: 'VT323', monospace;
            font-size: 100px;
            color: #cc0000;
            text-shadow: 0 0 30px #ff0000;
            animation: flicker 0.08s infinite alternate;
            letter-spacing: 8px;
        }
        @keyframes flicker { 0%{opacity:1} 100%{opacity:0.85} }
        .files-not-now-sub {
            font-family: 'Share Tech Mono', monospace;
            font-size: 12px;
            color: #333;
            margin-top: 16px;
            letter-spacing: 3px;
            text-align: center;
        }
        .files-not-now-close {
            margin-top: 32px;
            font-family: 'Share Tech Mono', monospace;
            font-size: 12px;
            color: #2a2a2a;
            cursor: pointer;
            letter-spacing: 2px;
            border: 1px solid #1a1a1a;
            padding: 6px 18px;
            transition: color 0.2s, border-color 0.2s;
        }
        .files-not-now-close:hover { color: #555; border-color: #333; }

        /* Music toggle */
        #music-toggle {
            position: fixed;
            bottom: 20px;
            right: 28px;
            font-family: 'Share Tech Mono', monospace;
            font-size: 11px;
            color: #333;
            cursor: pointer;
            letter-spacing: 2px;
            z-index: 200;
            transition: color 0.2s;
            user-select: none;
        }
        #music-toggle:hover { color: #666; }
        #music-toggle.playing { color: #f0f; }
    </style>
</head>
<body onclick="startSys()">

<div class="background-missing"></div>
<div class="crt-effect"></div>
<div class="crt-scanline"></div>
<div class="crt-glitch-band" id="crt-glitch"></div>

<!-- AUDIO -->
<audio id="bg-music" loop src="kulcs.bsp.mp3"></audio>
<audio id="snd-button2"  src="button2.wav"     preload="auto"></audio>
<audio id="snd-button3"  src="button3.wav"     preload="auto"></audio>
<audio id="snd-button9"  src="button9.wav"     preload="auto"></audio>
<audio id="snd-button18" src="button18.wav"    preload="auto"></audio>
<audio id="snd-friend"   src="friend_join.wav" preload="auto"></audio>

<!-- MAIN LAYOUT -->
<div class="container">

    <!-- Terminal -->
    <div class="terminal-window">
        <div class="terminal-header">SOURCEEXPLORER</div>
        <div class="nav-area">
            <div class="nav-item" onclick="handleVersion(event)">Version</div>
            <div class="nav-item" onclick="handleDoors(event)">Doors</div>

    <!-- Clock -->
    <div class="clock-window">

        </div>
    </div>
</div>

<div id="files-page">

        <div class="files-back" onclick="closeFiles()">← BACK</div>

    <div class="files-footer">
        <span id="file-page-indicator" style="font-family:'Share Tech Mono',monospace;font-size:12px;color:#333;letter-spacing:2px;margin-right:auto;">FILE 01 / 05</span>

            <div class="files-not-now-close" onclick="closeFilesNotNow()">[ CLOSE ]</div>
        </div>
    </div>
</div>

<div id="music-toggle" onclick="toggleMusic()">♪ MUSIC OFF</div>

<script>
// ===== AUDIO =====
function playSound(id) {
    const el = document.getElementById(id);
    if (!el) return;
    el.currentTime = 0;
    el.play().catch(() => {});
}

let musicStarted = false;
let musicPlaying = false;
const bgMusic = document.getElementById('bg-music');

function startSys() {
    if (!musicStarted) {
        musicStarted = true;
        bgMusic.volume = 0.35;
        bgMusic.play().then(() => {
            musicPlaying = true;
            updateMusicToggle();
        }).catch(() => {});
    }
}

function toggleMusic() {
    if (!musicStarted) { startSys(); return; }
    if (musicPlaying) {
        bgMusic.pause();
        musicPlaying = false;
    } else {
        bgMusic.play().catch(() => {});
        musicPlaying = true;
    }
    updateMusicToggle();
}

function updateMusicToggle() {
    const btn = document.getElementById('music-toggle');
    if (musicPlaying) {
        btn.textContent = '♪ MUSIC ON';
        btn.classList.add('playing');
    } else {
        btn.textContent = '♪ MUSIC OFF';
        btn.classList.remove('playing');
    }
}

// ===== ANALOG CLOCK =====
const clockFace = document.getElementById('clock-face');
for (let i = 1; i <= 12; i++) {
    const n = document.createElement('div');
    n.className = 'num';
    n.innerText = i;
    const rad = 155;
    const ang = (i * 30 - 90) * (Math.PI / 180);
    n.style.left = (180 + rad * Math.cos(ang) - 10) + 'px';
    n.style.top  = (180 + rad * Math.sin(ang) - 10) + 'px';
    clockFace.appendChild(n);
}

function tic() {
    const d = new Date();
    const sec = d.getSeconds() * 6;
    const min = d.getMinutes() * 6 + d.getSeconds() * 0.1;
    const hr  = (d.getHours() % 12) * 30 + d.getMinutes() * 0.5;
    document.getElementById('s').style.transform = `translateX(-50%) rotate(${sec}deg)`;
    document.getElementById('m').style.transform = `translateX(-50%) rotate(${min}deg)`;
    document.getElementById('h').style.transform = `translateX(-50%) rotate(${hr}deg)`;
}
setInterval(tic, 1000);
tic();

// ===== DIGITAL COUNTDOWN =====
const TARGET = new Date('2026-03-13T00:00:00');

function updateCountdown() {
    const diff = TARGET - new Date();
    if (diff <= 0) {
        document.getElementById('cd-days').textContent = '000';
        document.getElementById('cd-hh').textContent   = '00';
        document.getElementById('cd-mm').textContent   = '00';
        document.getElementById('cd-ss').textContent   = '00';
        return;
    }
    const totalSecs = Math.floor(diff / 1000);
    const days = Math.floor(totalSecs / 86400);
    const hrs  = Math.floor((totalSecs % 86400) / 3600);
    const mins = Math.floor((totalSecs % 3600) / 60);
    const secs = totalSecs % 60;
    document.getElementById('cd-days').textContent = String(days).padStart(3,'0');
    document.getElementById('cd-hh').textContent   = String(hrs).padStart(2,'0');
    document.getElementById('cd-mm').textContent   = String(mins).padStart(2,'0');
    document.getElementById('cd-ss').textContent   = String(secs).padStart(2,'0');
}
updateCountdown();
setInterval(updateCountdown, 1000);

// ===== BEEP SYSTEM (escalates as deadline approaches) =====
let beepStarted = false;
function runBeep() {
    const diff = TARGET - new Date();
    const progress = Math.max(0, 1 - (diff / (30 * 24 * 60 * 60 * 1000)));
    const b = document.getElementById('snd-button3');
    if (b) {
        b.volume = Math.min(1, 0.1 + progress * 0.9);
        b.currentTime = 0;
        b.play().catch(() => {});
    }
    setTimeout(runBeep, 2000 - (progress * 1900));
}

// ===== MENU ACTIONS =====
function handleVersion(e) {
    e && e.stopPropagation();
    playSound('snd-button9');
    showMsg();
}
function handleDoors(e) {
    e && e.stopPropagation();
    playSound('snd-button18');
    showMsg();
}
function handleFiles(e) {
    e && e.stopPropagation();
    playSound('snd-button2');
    openFiles();
}

function showMsg() {
    playSound('snd-message');
    const msg = document.getElementById('msg-box');
    msg.innerText = 'not now.';
    setTimeout(() => { msg.innerText = ''; }, 2000);
}

let currentFilePage = 1;

function openFiles() {
    currentFilePage = 1;
    const frame = document.getElementById('pdf-frame');
    frame.src = 'data:application/pdf;base64,' + PDF_B64;
    document.getElementById('file-page-indicator').textContent = 'FILE 01 / 05';
    document.getElementById('files-page').classList.add('active');
    playSound('snd-friend');
}

function closeFiles() {
    playSound('snd-button3');
    document.getElementById('files-page').classList.remove('active');
    closeFilesNotNow();
}

function handleNext() {
    if (currentFilePage === 1) {
        currentFilePage = 2;
        playSound('snd-button2');
        document.getElementById('pdf-frame').src = 'data:application/pdf;base64,' + PDF2_B64;
        document.getElementById('file-page-indicator').textContent = 'FILE 02 / 05';
    } else if (currentFilePage === 2) {
        currentFilePage = 3;
        playSound('snd-button2');
        document.getElementById('pdf-frame').src = 'data:application/pdf;base64,' + PDF3_B64;
        document.getElementById('file-page-indicator').textContent = 'FILE 03 / 05';
    } else if (currentFilePage === 3) {
        currentFilePage = 4;
        playSound('snd-button2');
        document.getElementById('pdf-frame').src = 'data:application/pdf;base64,' + PDF4_B64;
        document.getElementById('file-page-indicator').textContent = 'FILE 04 / 05';
    } else if (currentFilePage === 4) {
        currentFilePage = 5;
        playSound('snd-button2');
        document.getElementById('pdf-frame').src = 'data:application/pdf;base64,' + PDF5_B64;
        document.getElementById('file-page-indicator').textContent = 'FILE 05 / 05';
    } else {
        showFilesNotNow();
    }
}

function showFilesNotNow() {
    playSound('snd-message');
    document.getElementById('files-not-now').classList.add('active');
}

function closeFilesNotNow() {
    playSound('snd-button3');
    document.getElementById('files-not-now').classList.remove('active');
}

// ===== CRT RANDOM GLITCH =====
function triggerGlitch() {
    const el = document.getElementById('crt-glitch');
    el.classList.add('active');
    setTimeout(() => el.classList.remove('active'), 150 + Math.random() * 100);
}
function scheduleGlitch() {
    setTimeout(() => { triggerGlitch(); scheduleGlitch(); }, 4000 + Math.random() * 10000);
}
scheduleGlitch();
